import './App.css';
import "./components/buisnessCard"
import BuissnessCard from './components/buisnessCard';
import DropDown from './components/dropdown';
import {useState} from "react";
import PhoneDropDown from './components/phoneDropDown';

function App() {

  const [turn, setTurn] = useState("");
  const [hidePhone, setHidePhone] = useState("hide");
  const [hideSocials, setHideSocials] = useState("hide");
  const [hideInfo, setHideInfo] = useState("hide");
  const [hidePhoneSpace, setHidePhoneSpace] = useState("hide");

  return (
    <div className="App">
      <BuissnessCard 
        turn={turn}
        setTurn={setTurn}
        setHidePhone={setHidePhone}
        setHidePhoneSpace={setHidePhoneSpace}
        setHideSocials={setHideSocials}
        setHideInfo={setHideInfo}
        />

      <PhoneDropDown 
        turn={turn}
        hidePhone
      />
    </div>
  );
}

export default App;
